    <meta charset="UTF-8">

    <title>五笔编码实时显示工具</title>
    <style>
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
            font-family: "Microsoft YaHei", sans-serif;
        }
        
        body {
            background-color: #f5f7fa;
            color: #333;
            line-height: 1.6;
            padding: 20px;
        }
        
        .container {
            max-width: 800px;
            margin: 0 auto;
            background-color: white;
            border-radius: 10px;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.1);
            padding: 30px;
        }
        
        h1 {
            text-align: center;
            margin-bottom: 20px;
            color: #2c3e50;
        }
        
        .description {
            text-align: center;
            margin-bottom: 30px;
            color: #7f8c8d;
        }
        
        .stats {
            text-align: center;
            margin-bottom: 20px;
            color: #3498db;
            font-weight: bold;
        }
        
        .input-section {
            margin-bottom: 30px;
        }
        
        .input-label {
            display: block;
            margin-bottom: 8px;
            font-weight: bold;
        }
        
        #chinese-input {
            width: 100%;
            padding: 12px 15px;
            border: 2px solid #ddd;
            border-radius: 6px;
            font-size: 16px;
            transition: border-color 0.3s;
        }
        
        #chinese-input:focus {
            border-color: #3498db;
            outline: none;
        }
        
        .result-section {
            margin-top: 30px;
        }
        
        .result-label {
            display: block;
            margin-bottom: 10px;
            font-weight: bold;
        }
        
        #output-area {
            min-height: 200px;
            border: 1px solid #ddd;
            border-radius: 6px;
            padding: 15px;
            background-color: #f9f9f9;
            line-height: 2.5;
            font-size: 18px;
        }
        
        .char-container {
            display: inline-block;
            text-align: center;
            margin: 0 5px;
            vertical-align: top;
        }
        
        .code {
            font-size: 14px;
            color: #e74c3c;
            font-weight: bold;
            margin-bottom: 2px;
            background-color: #fff;
            padding: 2px 4px;
            border-radius: 3px;
            border: 1px solid #eee;
        }
        
        .char {
            font-size: 24px;
            margin-top: 2px;
        }
        
        .footer {
            text-align: center;
            margin-top: 30px;
            color: #95a5a6;
            font-size: 14px;
        }
        
        .instructions {
            background-color: #f8f9fa;
            border-left: 4px solid #3498db;
            padding: 15px;
            margin-top: 20px;
            border-radius: 0 4px 4px 0;
        }
        
        .instructions h3 {
            margin-bottom: 10px;
            color: #2c3e50;
        }
        
        .instructions ul {
            padding-left: 20px;
        }
        
        .instructions li {
            margin-bottom: 8px;
        }
    </style>
</head>
<body>
    <div class="container">
        <h1>五笔编码实时显示工具</h1>
        <p class="description">输入汉字，实时查看每个字对应的五笔编码</p>
        <div class="stats">码表包含 6890 个汉字</div>
        
        <div class="input-section">
            <label for="chinese-input" class="input-label">请输入汉字：</label>
            <input type="text" id="chinese-input" placeholder="在此输入汉字...">
        </div>
        
        <div class="result-section">
            <label class="result-label">编码显示：</label>
            <div id="output-area">
                输入汉字后，此处将显示每个字对应的五笔编码
            </div>
        </div>
        
        <div class="instructions">
            <h3>使用说明</h3>
            <ul>
                <li>在输入框中输入任意汉字，每个汉字上方会实时显示其五笔编码</li>
                <li>编码显示为大写字母</li>
                <li>如果某个汉字没有对应的编码，将显示为"---"</li>
                <li>当前码表包含 6890 个汉字</li>
            </ul>
        </div>
        
        <div class="footer">
            基于86五笔码表开发
        </div>
    </div>

        // 获取DOM元素
        const inputElement = document.getElementById('chinese-input');
        const outputElement = document.getElementById('output-area');
        
        // 输入事件处理
        inputElement.addEventListener('input', function() {
            const inputText = this.value;
            updateOutput(inputText);
        });
        
        // 更新输出区域
        function updateOutput(text) {
            if (!text) {
                outputElement.innerHTML = '输入汉字后，此处将显示每个字对应的五笔编码';
                return;
            }
            
            let outputHTML = '';
            
            for (let i = 0; i < text.length; i++) {
                const char = text[i];
                const code = wbCodeMap[char] || '---';
                
                outputHTML += `
                    <div class="char-container">
                        <div class="code">${code}</div>
                        <div class="char">${char}</div>
                    </div>
                `;
            }
            
            outputElement.innerHTML = outputHTML;
        }
        
        // 初始化示例
        updateOutput('五笔编码查询工具');
        inputElement.value = '五笔编码查询工具';
    </script>
